## Purpose

This API allows to login to an ARTECO-SERVER and provides all the information about it.

## Authentication method (Bearer token)

Authentication can be achieved sending username and password as a JSON payload in the body of the POST request. The response JSON will provide, if credentials are right, an access_token variable that must be used to authenticate all the others REST API.

Once that access_token has been obtained it is mandatory to use it in the Header of REST requests, such as:

```json
// payload example
{
	"username": "dalpi",
	"password": "061290"
}
```

## Responses

The operation will provide a JSON object named ***result*** which contains the status of the request.

